import Headers from "./Headers";
import Row from "./Row";

function ResultsTable(props) {
    return (
        <table>
            <tr>
                <Headers results={props.results}/>
            </tr>
            {
                props.results.map((row) => {
                    return (
                        <tr>
                            <Row row={row}/>
                        </tr>
                    )
                })
            };
        </table>
    );
}

export default ResultsTable;
